import './App.css';
import imgIcon from "./utils/images/hospital-icon.png";

const shrikhandFont = new FontFace('Shrikhand', 'url(https://fonts.gstatic.com/s/shrikhand/v12/9Ue9PJ8bGTU75AdU0UDEysZBaQ.ttf)');

// Carrega a fonte
shrikhandFont.load().then(function(loadedFont) {
  // Adiciona a fonte à folha de estilo
  document.fonts.add(loadedFont);

  // Aplica a fonte ao estilo do elemento desejado
  var meuElemento = document.getElementById('meuElemento'); // ou document.querySelector('.minhaClasse');
  meuElemento.style.fontFamily = 'Shrikhand, sans-serif';
}).catch(function(error) {
  console.error('Erro ao carregar a fonte:', error);
});



function App() {
  return (
    <main className="app-container">
      <div>
        <img src={ imgIcon } width="160px" alt="logo" />
      </div>
      <div className="register-container">
        <h1>Hospital</h1>      
        <input
          type="text"
          name="first-name"
          placeholder="First Name"
          className="register-input"
        />
        <input
          type="text"
          name="last-name"
          placeholder="Last Name"
          className="register-input"
        />
        <div>
          <input
            type="number"
            min="0"
            style={{ width: "40px" }}
            name="age"
            placeholder="Age"
            className="register-input"
          />
          <select
            className="register-input"
            placeholder="Gender"
          >
            <option value="" disabled selected>Gender</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
          </select>    
          <button className="send-btn">Send</button>
        </div>
      </div>
    </main>
  );
}

export default App;
